// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "./RoleAccess.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./event/events.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

contract CityNode is RoleAccess, Events, Initializable {

    address public TOX;
    bool  public voteStatus = true;
    uint256 public applyCityFee;
    uint256 public voteCost = 1;

    struct Vote {
        address user;
        address candidate;
        uint256 cityId;
        uint256 voteCost;
    }

    // candidate address => vote number
    mapping(address => uint256) public candidateCount;

    // cityId => []candidate address
    mapping(uint256 => address[]) public cityCandidate;

    address[] public cityNode;

    function initialize() public initializer {
        _addAdmin(msg.sender);
    }

    function AdminSetVoteStatus(bool voteStatus_) public onlyAdmin {
        voteStatus = voteStatus_;
    }

    function AdminSetVoteCost(uint256 voteCost_) public onlyAdmin {
        voteCost = voteCost_;
    }

    function AdminSetApplyCityFee(uint256 applyCityFee_) public onlyAdmin {
        applyCityFee = applyCityFee_;
    }

    function AdminTOXAddress(address TOX_) public onlyAdmin {
        TOX = TOX_;
    }

    // apply city candidate
    function applyCityCandidate(uint256 cityId) external {
        uint256 userBalance = IERC20(TOX).balanceOf(msg.sender);
        require(userBalance >= applyCityFee, "Insufficient balance");
        IERC20(TOX).transferFrom(msg.sender, address(this), applyCityFee);

        cityCandidate[cityId].push(msg.sender);
        emit ApplyCandidateRecord(
            msg.sender,
            applyCityFee
        );
    }

    // vote for candidate
    function vote(address candidate, uint256 cityId) external {
        require(voteStatus, "Voting has ended");
        uint256 userBalance = IERC20(TOX).balanceOf(msg.sender);
        require(userBalance >= 1, "Insufficient balance");
        IERC20(TOX).transferFrom(msg.sender, address(this), voteCost);

        emit VoteRecord(
            msg.sender,
            candidate,
            cityId,
            voteCost
        );

        candidateCount[candidate] += 1;
    }

    // Count the number of candidates' votes and obtain the election results
    function countVoteResult(uint256 cityId) public onlyAdmin returns (address){
        require(!voteStatus, "Voting in progress");
        address[] storage allCandidate = cityCandidate[cityId];
        if (allCandidate.length == 0) {
            return address(0);
        } else if (allCandidate.length == 1) {
            return allCandidate[1];
        }
        address small = address(0);
        address big = address(0);
        for (uint i = 1; i < allCandidate.length; i++) {
            for (uint j; j < allCandidate.length - 1; j++) {
                if (candidateCount[allCandidate[j]] > candidateCount[allCandidate[j + 1]]) {
                    small = allCandidate[j + 1];
                    big = allCandidate[j];
                    allCandidate[j + 1] = big;
                    allCandidate[j] = small;
                }
            }
        }
        cityNode.push(allCandidate[allCandidate.length - 1]);
        return allCandidate[allCandidate.length - 1];
    }
}

